import fetchPosts from "../api/api";

const Home = async ({posts, setPosts}) => {
    const data = await fetchPosts();
    return (<div>
    {data.posts.map((posts, index) => {
        <p>{posts}</p>
    })}
    </div>
    )
}

export default Home;
